import { Marker } from '@react-google-maps/api'

export const MarkerQuery = ({ rest }) => {
  const { query } = rest

  return <Marker
    position={{ lat: Number(query.lat), lng: Number(query.lng) }}
    icon={{ url: `http://326b53d9806dcac09833-a590b81c812a57d0f4b1c3b1d1b7a9ea.r50.cf3.rackcdn.com/markersIcon/${query.isType}.png` }}
  />
}
